(7, 1227329, 931070, 6, '2016-02-09', 'S1 Rating Granted', '<p>Congratulations you have proven yourself able for the rating of S1.</p>'),
(8, 1302705, 931070, 6, '2016-02-09', 'S1 Rating Granted', '<p>The student has proven himself competent on the positions of DEL/GND and has been granted his S1 rating to allow further training and rating progression.</p>'),
(9, 1227329, 931070, 4, '2016-02-12', 'EIDW_GND Validation', '<p>Student Validated on Dublin Ground.</p>'),
