(11, 1241902, 1031024, 6, '2016-04-04', 'Requires Checkout', '<p>Ray is a transferring controller and requires an OTS as per the transferring controllers policy.&nbsp;</p>'),
(12, 1227329, 1031024, 6, '2016-04-12', 'Historic Session', '<p>Took Sam for a very impromptu session on Sunday. We covered a lot of the theory around separation, airspace and how arrivals work, before vectoring just the one aircraft on Sweatbox. Lots to take in and so a fairly slow session, but hopefully the building blocks are there.&nbsp;</p>'),
(13, 1281280, 931070, 4, '2016-04-13', 'Dublin Tower', ''),
