(15, 1122778, 1032602, 6, '2016-06-19', 'Account fixed', '<p>Uncorrelated controller and student records in the database meant&nbsp;requesting mentoring was rendered&nbsp;impossible. This has been fixed.</p>'),
(16, 1281627, 931070, 6, '2016-07-03', 'S1 Theory Issued', '<p>As Above.</p>');
