INSERT INTO `reports` (`id`, `student_cid`, `mentor_cid`, `report_type_id`, `position_id`, `submitted_date`, `session_date`, `text`) VALUES
(1, 1211640, 931070, 2, 13, '2015-08-08', '2015-08-02', '<p>Initial session client setup and basic explanation of functionality. &nbsp;Connected to network as OBS. &nbsp;Covered the role of Delivery in regards to ATC responsibilities.</p>'),
(2, 1211640, 931070, 2, 14, '2015-08-11', '2015-08-11', '<p>No Show.</p>'),
(3, 1211640, 931070, 2, 14, '2015-08-16', '2015-08-06', '<p>Building upon the initial session we working further on DEL, and started on GND. &nbsp;We discuss separation, both actual and technical, and using the scenario file demonstrated some of these principles.</p>'),
(4, 1046871, 931070, 4, 3, '2015-08-16', '2015-07-22', '<p>No show.</p>'),
(5, 1232832, 931070, 4, 25, '2015-08-16', '2015-08-02', '<p>Showed up 45 minutes late. &nbsp;Warned that&nbsp;further missed sessions without even an email of apology will not be acceptable.</p>'),
(6, 1316548, 931070, 2, 13, '2015-08-16', '2015-08-03', '<p>Covered the basics of the client (Setup, Functionality etc) and connected to the network where network dependent&nbsp;functionality was covered.</p>'),
(7, 1316548, 931070, 2, 14, '2015-08-16', '2015-08-04', '<p>We started the session by covering the role of a DEL controller and how these roles are achieved. &nbsp;Flight-plans and what to check for was covered in detail, including the code/call-sign conversion and its use on VATSIM. &nbsp;RT was covered and several aircraft given clearances. &nbsp;</p><p>As we had made good progress to this point we started upon GND and what that entails. &nbsp;We covered separation, both actual and technical, RT to be employed and the use of conditional clearances. &nbsp;We taxied the previously cleared aircraft to the holding point where the were handed over to tower and handled in-bounds to the gate.</p><p>Sean struggled initially with RT, most of this however appears to be nervousness&nbsp;as he has a good technical understanding of what is requires.</p>'),
(8, 1316548, 931070, 2, 14, '2015-08-16', '2015-08-11', '<p>A busy&nbsp;GND session with Cillian Long helping with the blip driving. &nbsp;Sean performed well overall, but has a tendency to over control, but this should decrease with increased experience. &nbsp;Similiarly he needs to break some instruction into multiple smaller instructions, especially for arriving aircraft, as he has a tendency of clearing them all the way to the gate - reducing the flexibility with other aircraft around the field.</p><p>Sean still seems nervous with R/T, but is improving this aspect of his controlling.</p>'),
(9, 1211640, 931070, 2, 14, '2015-08-18', '2015-08-17', '<p>Session cancelled by both parties.</p>'),
(10, 1211640, 931070, 2, 14, '2015-08-18', '2015-08-18', '<p>Building upon the previous session and started GND. &nbsp;DEL functions carried out well, with amendments to FP details carried out.</p><p>GND responsibilities restated and aircraft taxied to and from the runway. &nbsp; Student needs to work on the bigger picture as on several occasions he worked himself into a corner necessarily. &nbsp; This also led to two losses of separation between aircraft - something that will need to be watched going forward.<br></p>'),
(11, 1281280, 931070, 2, 14, '2015-08-23', '2015-08-23', '<p>A god first session. The student has started his PPL at EICK so has a good understanding of not only aircraft, but of ATC. To his credit he has done a good deal of prep-work for this session both with the client and prescribed reading from the VATEUD TD site.</p><p>We covered the responsibilities of both delivery and ground, what to look for in a FP, and how to make corrections. The structure of clearance including departure freqs. These were practiced and the aircraft subsequently taxied to the active runway and handed over to tower.</p><p>Work needs to be done on taxiclearances but for a first session this was good.</p>'),
(12, 1281280, 931070, 2, 14, '2015-08-29', '2015-08-29', '<p>a good session on Dublin Ground. &nbsp;The student carried on from the last time and is improving well. &nbsp;One or tow initial R/T error in regards to departure frequency and qnh, but these were self corrected and did not occur again.</p><p>The students&nbsp;situational awareness is getting better and he is spotting potential problems before they happen.</p><p>With the next session we will start on tower. &nbsp;I will also be recommending that the student be issued his S1 theory token.</p>'),
(13, 1231276, 931070, 4, 18, '2015-09-05', '2015-08-30', '<p>No session due to event.</p>'),
(14, 1231276, 931070, 3, 18, '2015-09-05', '2015-09-05', '<p>a check session with Mark to set a benchmark of where his controlling is with respect to tower. &nbsp;As it had not been explained to him before we covered AB/CD aircraft types and the departures. &nbsp;We also covered separation around the aerodrome and the difference between actual separation and technical separation. &nbsp;Mark took both on board and demonstrated the application of both topics covered.</p>'),
(15, 1304314, 931070, 3, 18, '2015-11-29', '2015-07-11', '<p>One hour session on Rwt 16 initially. &nbsp;Three departures correctly sequenced for the SID - LIFFY/DEXEN/LIFFY with positive gnd instructions used to cerate same. &nbsp;One item unable Rwy16 requested Rwy 28 for performance issues and co-oridnating non-standard departure covered. &nbsp;Changed from Rwy16 to Rwy 28 for the last few departures due to wind changes - we had covered runway chagnes oin a previous SW session, however this was the first time on the network and communication with other ATC units needs to be worked on.</p>'),
(16, 1304314, 931070, 3, 27, '2015-11-29', '2015-07-14', '<p>Covered the differences between the regional airports and the three main airports in regards to clearances and releases. &nbsp;This was practised with two IFR departures, both co-ordinated with EISN_CTR, but with differing departure instructions. &nbsp;We spoke about procedural approach and how working in a non-radar environment differed from a radar one. &nbsp;A basic understanding of procedural approach was covered, and the student shown how to give a basic approach instruction, and where to get the pilot to report. No VFR was covered, but this will be covered in the next session anlong with re-enforcing the IFR procedures.</p>'),
(17, 1304314, 931070, 4, 18, '2015-11-29', '2015-07-21', '<p>A good session - multiple arrivals and departures with a mixture of /v, /r and /t all of which Paul handled well. &nbsp;No VFR component to the session.</p>'),
(18, 1304314, 931070, 4, 27, '2015-11-29', '2015-07-26', '<p>VFR Circuit baching - Max three in the seperation with two joins from uncontrolled airspace. &nbsp;Traffic pattern was handled well, with the arriving traffic integrated sucessulyy. &nbsp;No IFR traffic this session. &nbsp;Student needs to work on his RT as he got some of the transmissions messed up, however, with practise this should not be an issue.</p>'),
(19, 1304314, 931070, 2, 0, '2015-11-29', '2015-08-10', '<p>slow session with low traffic levels, most on freq was 3. &nbsp;All were handled competently.</p>'),
(20, 1304314, 931070, 3, 18, '2015-11-29', '2015-08-16', '<p>A busy session, with several arrivals and departures. &nbsp;Paul handled all well, with minimal issues. &nbsp;Lack of VFR is becoming a bottleneck to training.</p>'),
(21, 1216625, 1220065, 4, 18, '2015-12-27', '2015-12-27', '<p>Student did well, Needs work on dealing with stress and seeing the bigger picture.&nbsp;</p>'),
(22, 1048023, 1220065, 4, 18, '2015-12-27', '2015-12-27', '<p>Performed Well, especially after such a long time away, remembered a lot. Corrected a couple of mistakes that we used to use back when Chris was controlling. Only three things needs working on.</p><ul><li>Radio Telefonica needs to be brushed up on.</li><li>Need to be faster on responding to calls via text and voice</li><li>Situational Awareness, keeping up with the departures list (SQK Setting, Initial Flight Levels etc)</li></ul><p>Remeber the following:</p><ul><li>Departure freq given on initial clearance and on take-off clearance</li><li>QNH only given on push back, unless it changes&nbsp;</li></ul><p>Will need to do a sim session to test what Chris is like under pressure and VFR will need to be looked at.</p>'),
(23, 1304314, 931070, 3, 18, '2015-12-28', '2015-09-05', '<p>Slow session withon ly a few movements. &nbsp;Paul handled these well and no operational errors were noted.</p>'),
(24, 1304314, 931070, 3, 18, '2015-12-28', '2015-09-10', '<p>Busy session with alot of aricraft into and out of the airport. &nbsp;Well handled and Paul is beginning ot show alot of confidence handling busy environments. &nbsp;A small bit of work is required on VFR to get him fully upto speed. &nbsp;Nearly ready for his STV.</p>'),
(25, 1211640, 1220065, 2, 14, '2015-12-28', '2015-12-28', '<p>Neil did very well. I covered the following topics</p><ul><li>Euroscope features eg, Departure List, Hardware Setup etc</li><li>Went over all of the R/T from Giving clearences to Taxiing</li><li>Went back over METARS</li><li>Went over un-standard departures and type A/B C/D SIDS</li></ul><p>Need to do sim session to test what Neil is like under pressure and to show him what controlling is like with a volume of aircraft.</p>'),
(26, 1267564, 1220065, 3, 18, '2015-12-28', '2015-12-28', '<p>No Show.</p>'),
(27, 1216625, 931070, 4, 18, '2016-01-01', '2015-12-28', '<p>Scenario file in Dublin 28 - Jack handled the traffoc well for the most part, a bit rusty at first, but much improved by the end. &nbsp;A clarification was needed on departure frequencies, but once corrected remained correct.</p><p><br></p><p><strike>Sliders not working for reports.</strike></p><p>Sliders are working! :-) - Cillian<br></p>'),
(28, 1302705, 1031024, 1, 14, '2016-01-06', '2016-01-06', '<p>A no show, although Nathan has contacted me to apologise&nbsp;</p>'),
(29, 1220065, 931070, 4, 3, '2016-01-10', '2015-07-14', '<p>Familiarisation session on Cork tower to show the intricacies of the runway configuration and tight apron space.</p>'),
(30, 1220065, 931070, 4, 27, '2016-01-10', '2015-07-16', '<p>Waterford Tower scenario file to go through the fundemantals of IFR at a regional and to cover some VFR circuits and integrating them with the IFR.</p>'),
(31, 1220065, 931070, 4, 18, '2016-01-10', '2015-07-18', '<p>Pre-Exam check out on Dublin Tower. &nbsp;Handled all traffic to a high level as to be expected.</p>'),
(32, 1220065, 931070, 5, 18, '2016-01-10', '2015-07-23', '<p>Tower exam on Dublin Tower. Pass.</p>'),
(33, 1302705, 1220065, 1, 13, '2016-01-11', '2016-01-11', '<p>Went through everything for the basics of delivery and basic ground. He tells me his&nbsp;Euroscope is fully set up but I did not get to check this as he is using &nbsp;Windows XP&nbsp;and couldnt send a screenshot and his team-viewer was incompatible.</p><p>Nathan has a good knowledge of the R/T before we started and is able to run through a full session from clearance to taxi.&nbsp;</p><p><b>Topics Covered:</b></p><ol><li><i>METARS</i><br></li><li><i>CAT A/B C/D SIDS</i><br></li><li><i>Odd and Even flight levels</i><br></li></ol><p><br></p><p><b>Need to do:</b></p><ol><li><i>Sweatbox&nbsp;Session on ground</i><br></li><li><i>S1 Theory Test</i><br></li><li><i>Check his Euroscope is set up correctly</i></li></ol>'),
(34, 1231276, 931070, 6, 11, '2016-01-12', '2016-01-11', '<p>An initial session to see where Mark standin relation to approach skills. &nbsp;Some basic theoretical knowledge was missing - such as calculating the transition level, and standard descetns (3-1), rate of descent etc. &nbsp;We worked through these and will continue to work on thebasics over the next couple of sessions.</p>'),
(35, 1220065, 931070, 7, 11, '2016-01-12', '2015-12-28', '<p>Introductory session. &nbsp;Configured ES to display tags correctly for a radar environment and went through some of the basics such as transition level, calculation of same.</p>'),
(36, 1231276, 931070, 6, 23, '2016-01-13', '2016-01-13', '<p>Called off late by both parties.</p>'),
(38, 1302705, 1220065, 2, 14, '2016-01-15', '2016-01-15', '<p>Turns out Nathan had old VATeir sct file so spent hour re doing whole euroscope and he is now set up to start controlling</p>'),
(40, 1180739, 931070, 4, 18, '2016-01-16', '2016-01-16', '<p>Departures freqs, types and VFR covered. &nbsp;No traffic handled as Eric had to leave.</p>'),
(42, 1231276, 931070, 7, 11, '2016-01-16', '2016-01-14', '<p>Covered the basics of Altimetry, tags and seperation. &nbsp;Some basic controlling to explain distance/height and the use of speed.</p>'),
(43, 1158360, 931070, 3, 18, '2016-01-17', '2016-01-17', '<p>No Show.</p>'),
(44, 1302705, 1220065, 2, 14, '2016-01-21', '2016-01-21', '<p>Needs to work on knowing what he says before saying it, Situational Awareness, Technical Seperation.</p>'),
(45, 1220065, 931070, 7, 11, '2016-01-23', '2016-01-16', '<p>Setting up ES to show approach arispace, tags and explanation of the responsisbilities of a radar controller.</p>'),
(46, 1231276, 931070, 7, 11, '2016-01-23', '2016-01-16', '<p>Back to basics session. &nbsp;Covered altimetry (TA/TL etc) seperation and some basic rules of thumb (3-1, descent rates) - further sessions to follow.</p>'),
(47, 1048023, 931070, 4, 18, '2016-01-23', '2016-01-17', '<p>Check out session after an absence from VATSIM. &nbsp;Student did not know of the AB/DC departures. &nbsp;Incorrect departure goven to 3 of 3 aircraft requiring AB depts instead of CD. &nbsp;No departure frequency given with clearance, and knowledge of departure sectors lacking. &nbsp;Missed several incorrect readbacks from pilots - including incorrect QNH. &nbsp;Over use of Break Break when not required. &nbsp;Further session(s) required.</p>'),
(48, 1345847, 931070, 2, 13, '2016-01-23', '2016-01-19', '<p>NO SESION - THIS IS A SECOND ACCOUTN AND HAS BEEN PERM BANNED.</p>'),
(49, 1345847, 931070, 2, 13, '2016-01-23', '2016-01-23', '<p>&nbsp; NO SESION - THIS IS A SECOND ACCOUTN AND HAS BEEN PERM BANNED. &nbsp;</p>'),
(50, 1302705, 1220065, 2, 14, '2016-01-24', '2016-01-24', '<p>Needs to work on Situational Awareness and Techincal Seperation but big improvement from last session!</p>'),
(51, 1211640, 1220065, 2, 14, '2016-01-24', '2016-01-24', '<p>No Show.</p>'),
(52, 1304314, 931070, 4, 3, '2016-01-25', '2016-01-23', '<p>Check out on Cork tower to see how Paul has progressed using his solo validation. &nbsp;Handled the scenario file well with no issues to speak of. &nbsp;Needs to pay attention to the self maneuvering stands at Cork, but that was his only real issue. &nbsp;Will hold one or two more scenario sessions to get him used to traffic levels before his S2 exam.</p>'),
(53, 1227329, 931070, 2, 14, '2016-01-27', '2016-01-26', '<p>ES setup, connected to sweatbox, initial session on role of ATC and some delivery/ground theory/practice. &nbsp;A good first session.</p>'),
(54, 1211640, 931070, 2, 14, '2016-01-27', '2016-01-23', '<p>a refresher session. &nbsp;Started OK, but there seems to be an issue with Neil and sweat-box causing very erratic movements from the aircraft. &nbsp;This prevented any meaningful ground operations.</p>'),
(55, 1302705, 1220065, 2, 2, '2016-01-31', '2016-01-29', '<p>Big improvement from last day, changed it up with Cork. Only slight mistakes one missed flight level of many, Again Situational Awareness needs work and Technical Separation. Just thinking ahead before you give people taxi instrcutions getting ATRs off C instead of A etc. But probably 1-2 more sessions and should be done. Also did unstandard departures</p>'),
(56, 1302705, 1220065, 2, 14, '2016-02-05', '2016-02-05', '<p>Miles better than last time but make sure you check sqawk codes and tags but identified all flight plan erros etc very well. Well done</p>'),
(57, 1229375, 1220065, 3, 18, '2016-02-07', '2015-12-31', '<p>No Show</p>'),
(58, 1227329, 931070, 2, 14, '2016-02-09', '2016-01-27', '<p>Solid second session with delivery and ground covered. &nbsp;Student needs to watch out for QNH on push-back, but apart from that nothing to note.</p>'),
(59, 1227329, 931070, 2, 2, '2016-02-09', '2016-01-28', '<p>Session on Cork tower to test out the students ability to apply his knowledge to a different airfield with minimal briefing. &nbsp;Overall went well with no major problems.</p>'),
(60, 1227329, 931070, 2, 24, '2016-02-09', '2016-02-07', '<p>S1 check out on Shannon Ground. No briefing given prior to starting to further test students ability to apply previously learned knowledge. All aircraft handled competently with minimal delay. S1 rating to be granted to allow for further training on the live network.</p>'),
(61, 1302705, 931070, 2, 24, '2016-02-09', '2016-02-07', '<p>S1 practical test on Shannon Ground. &nbsp;No aerodrome briefing given to see if the controller could apply previously learned skills to a new airfield. &nbsp;Competent performance and S1 rating to be granted to allow further rating progression.</p>'),
(62, 1227329, 931070, 3, 18, '2016-02-12', '2016-02-12', '<p>Network session on Dublin Tower. &nbsp;Student handled all traffic well, including text and VFR. &nbsp;Solo ground validation given. &nbsp;Next session will work on tower skills in more detail.</p>'),
(63, 1227329, 931070, 3, 18, '2016-02-17', '2016-02-17', '<p>live session on Dublin Tower. &nbsp;The student&nbsp;manned the position, choose active runway,&nbsp;set up ATIS etc with minimum fuss. &nbsp;Light traffic, but a mix of /T/and ?V. &nbsp;All handled well. &nbsp;In depth discussion about VFR and how to&nbsp;handle it in general, circuits etc and how to handle it in the context of Dublin. &nbsp;VRPs, routing and hlds discuss. &nbsp;On the back of this and previous session the student has been given his STV for Dublin.</p>'),
(64, 1231276, 1031024, 6, 11, '2016-02-19', '2016-02-10', '<p>Nothing dramatic really to discuss, but due to traffic levels I cant comment on everything. We discussed some bits on altimetery(sp?!) and youve started to demonstrate an understanding of this; theres more to pressure than MSL though!</p><p>You need to be more aware of planning ahead, especially in the last 5 or 10 miles before aircraft establish. What will happen to their speed, their turning capabilities, their descent profile...?</p>'),
(65, 1302705, 1220065, 3, 18, '2016-02-20', '2016-02-19', '<p>No progress made his euro scope doesnt save any settings because hes on windows XP. Need to change to Windows 7 as no point of progressing any further&nbsp;</p>'),
(66, 1227329, 931070, 4, 3, '2016-02-23', '2016-02-23', '<p>Session on Rwy 17. &nbsp;Student handled the traffic well until IT issues caused all aircraft t o crash abeam C on Rwy 17.</p>'),
(67, 1231276, 1031024, 9, 30, '2016-02-25', '2016-02-24', '<p>An OK session. Not busy, but we focussed on picking things up from afar and dealing with traffic as it presents itself. Some focus on vectoring and dealing with descent management and a bit of a talk about altimetery and flows through the FIR.&nbsp;</p>'),
(68, 1231276, 1031024, 10, 30, '2016-03-02', '2016-02-26', '<p>Some fun on a sweatbox scenario. Youre starting to see a bit further into the future and understand the importance of making a plan and sticking to it, just remember to make your plan happen rather than change your plan, unless, of course, external influence prohibits you from doing so.</p><p>Technical separation was a big focus of this and youre starting to demonstrate an understanding of its implementation. Youve got the scenario file, keep plugging away at it and utilise your radar time on Dublin Approach to hone your skills.&nbsp;</p>'),
(69, 1048023, 931070, 4, 18, '2016-03-12', '2016-01-21', '<p>Check out on Dublin Tower. &nbsp;Much improved since last session and no operational mistakes made.</p>'),
(70, 1158360, 931070, 4, 3, '2016-03-12', '2016-01-29', '<p>No. Show.</p>'),
(71, 1180739, 931070, 4, 18, '2016-03-12', '2016-02-15', '<p>Tower check out for Tower validation. &nbsp;Student was poor and demonstrated a poor ability to control under a relatively light work load. &nbsp;Lack of knowledge for tactical and actual separation was shown, with departure clearance given to an aircraft while another aircraft was performing a go around as requested by the student.</p><p><br></p>'),
(72, 1227329, 931070, 4, 27, '2016-03-12', '2016-02-24', '<p>Session to cover VFR and basic Regional operations. &nbsp;Light traffic load - a mix of VFR and IFR. &nbsp;Handled competently by the student.</p>'),
(73, 1304314, 931070, 3, 18, '2016-03-12', '2016-03-07', '<p>.</p>'),
(74, 1304314, 931070, 5, 18, '2016-03-12', '2016-03-09', '<p>Student failed to pass due to VFR issues. &nbsp;IFR handling was fine, but lack of VFR practice resulted in the decision not to pass him until further VFR training can be arranged.</p>'),
(75, 1227329, 931070, 4, 18, '2016-03-12', '2016-03-10', '<p>No session as mentor got dates mixed up.</p>'),
(76, 1229375, 931070, 4, 18, '2016-03-12', '2016-03-12', '<p>Second no-show.</p>'),
(77, 1227329, 931070, 5, 18, '2016-03-16', '2016-03-16', '<p>he passed.</p>'),
(78, 1254805, 1031024, 9, 30, '2016-03-24', '2016-03-23', '<p>Actually a really good session. Did some work on the live network to pick up things like scans, working at range before moving to sweatbox for some pretty intense scenarios. Youve coped well and consequently Ill award you a solo validation.&nbsp;</p>'),
(79, 1211640, 931070, 2, 14, '2016-03-26', '2016-03-25', '<p>A good refresher session using Dublin Rwy 28. &nbsp;20+ movements as ground handled to a good level. &nbsp;The student needs to pay attention to giving QNH on push back as this was omitted on occasion.</p>'),
(80, 1281280, 931070, 2, 14, '2016-03-28', '2016-03-28', '<p>First session in a while. &nbsp;Started off by covering back over previous sessions and covering topics such as technical separation, taxiway limitations etc. &nbsp;Session was on EIDW_GND using Rwy28. &nbsp;Student handled the file well, with no operational errors. &nbsp;Needs to work on breaking down overly complex taxi instructions.</p>'),
(81, 1302705, 1031024, 3, 18, '2016-03-29', '2016-03-29', '<p>This turned into a theory session as your internet connection is horrific and it wasnt practical to control. Weve discussed a lot around air traffic management concepts, what we need to consider as Tower controller and where we fit into the bigger picture as aerodrome controllers.</p><p>Remember that your progress will be driven by your own motivation, so take the time to read up on things and observe other controllers in advance of your next session.&nbsp;</p>'),
(82, 1302705, 1220065, 3, 18, '2016-03-31', '2016-03-30', '<p>Situational awareness was quite good. Ran through a full Dublin sim session on 28 2 planes crashed due to lack of technical separation but for a first time he performed very well. Want to go over technical separation and go around procedures. Haven''t touched on any VFR yet.</p>'),
(83, 1211640, 931070, 2, 14, '2016-04-05', '2016-03-25', '<p>Good session. &nbsp;Rwy 28 in use with normal scenario file traffic levels. &nbsp;Handled well by the student. &nbsp;</p>'),
(84, 1281280, 931070, 2, 24, '2016-04-05', '2016-03-31', '<p>Rwy 24. &nbsp;After as brief differences brief (lack of departure freq in clearance, no A/B, C/D sids etc) the student controlled as ground. &nbsp;All traffic handled competently, with a plan and purpose to each instruction. &nbsp;Was able to apply learned techniques from Dublin to Shannon with minimal effort.</p>'),
(85, 1281280, 931070, 2, 14, '2016-04-05', '2016-04-03', '<p>I forgot :(</p>'),
(86, 1281280, 931070, 2, 14, '2016-04-05', '2016-04-05', '<p>Session as EIDW_TWR. &nbsp;Rwy 16. &nbsp;First time for the student on Tower and using Rwy 16. &nbsp;We covered the basics of tower responsibilities, types pf service expected and radio telephony. &nbsp; As Rwy 16 was in use it was highlighted to the student the importance of taxiway clearances due to aircraft size. &nbsp;This was good for the most part, however, technical separation was lost on occasion due to wing tip clearance. &nbsp;The student quickly spotted this loss of separation and corrected. &nbsp;For a first tower session it was good, we tried a few things, most of them worked but it was a valuable learning experience.</p>'),
(87, 1302705, 1254805, 3, 18, '2016-04-06', '2016-04-06', '<p>Threw you in the deep end with this one, RWY16 file with 14 departures and 12 arrivals.</p><p><b><br></b></p><p><b>Theory: </b>We went through airspace classes in the FIR (A, C, G) and discussed the procedures and needs for clearences for each one.</p><p>Discussed Runway preference and capacity, leading onto how RETs facilitate a higher runway capacity/hour. Discussed arrival procedures available for each runway and the benefits, again relating to capacity.</p><p><br></p><p><b>Sweatbox: </b><i>Technical Separation:</i>&nbsp;Was the weakest of all areas. 2-3 crashes due to a lack of separation by clearing aircraft to the same LINKs for F. <u>This can be easily avoided by giving intermediate holding points</u>&nbsp;during taxi.&nbsp;(Hold short of F on LINK3, traffic to cross on F etc) <u>Dont clear an arrival&nbsp;into a cul de sac if there is an aircraft in the middle of pushback in the same area! </u><b>You need to plan ahead.</b></p><p><i>Prioritisation: </i>An aircraft in a cul de sac can wait for push clearance for 10 seconds as opposed to an arrival coming in at 145kts awaiting landing clearance for&nbsp;the same amount of time. <u>Prioritise your transmissions</u>, each second counts when you have an arrival closing in&nbsp;on the threshold with a departure about to rotate.</p><p><br></p><p>Theory well understood and applied in the simulation, but remember that co-ordination with everybody is hugely important. Simulation was good in an&nbsp;R/T aspect but weak in separation and planning wasnt evident. <b>Thinking about the consequences of doing something before actually executing it&nbsp;can make a big difference.</b></p>'),
(88, 1232832, 1254805, 3, 18, '2016-04-10', '2016-04-09', '<p>Did theory on runway capacity, how RETs affect this, and the preferential runway. Discussed CAT A/B, C/D departures briefly although didnt go into much depth (will do more next time). Also did airspace classes A, C, G in depth.</p><p>Next session well talk about <b>winds</b>, how they dictate the <b>runway in use</b> and then talk&nbsp;about <b>runway changes</b> and how it is done from start to finish. Leading onto more <b>coordination</b> again.&nbsp;Well focus on <b>RT</b>. Keep it simple. Speaking too much and putting in unnecessary words will lead onto repeating&nbsp;transmissions&nbsp;and wasting time. Only use what is needed. Tell the pilots what to do, simply,&nbsp;and they should do it.<br></p><p>EIN147<b> Behind </b>the landing Ryanair 738 on a 1 mile final, runway 28 line up and wait <b>behind</b></p><p>EIN147 Runway 28 cleared for takeoff, surface winds 260 degrees 12 knots</p><p>UAE161 cross runway 16 at M1, vacate onto M2, report runway vacated</p><p>Put in more availability,&nbsp;well improve the RT and do more theory. You did very well from a flow point of view, the aircraft were always moving when they had to be and stationary when you had a plan, which was good to see. The one crash at LINK2 was inevitable, it was a very busy sweatbox.&nbsp;</p>'),
(89, 1302705, 1254805, 3, 18, '2016-04-13', '2016-04-13', '<p>Discussed Reason for selecting a runway, and LVPs also, and how this slows operations down due to CATIII ILS approaches and how no conditional clearences can be given.</p><p>R/T: Improved, you now know and give correct line up behind, departure, landing and taxi clearences<br></p><p>Technical separation, again, wasnt very evident. If arrivals&nbsp;are still on the runway and not yet vacated, you cannot give takeoff clearance, this happened on two occasions.</p><p>&nbsp;Recovering from losses of separation is important, dont sit there and sigh and forget about whats happening, deal with the situation at hand before it becomes a bigger problem.</p>'),
(90, 1281280, 931070, 3, 18, '2016-04-13', '2016-04-13', '<p>Stop saying&nbsp;AND at the start of transmissions</p>'),
(91, 1302705, 931070, 3, 18, '2016-04-20', '2016-04-20', '<p>Voice issues related to lag/ping caused issues all session. &nbsp;Needs to look at getting it sorted. &nbsp;Departure frequency needs to be given on all clearances. &nbsp;Student&nbsp;needs to think ahead. &nbsp;Each instruction seems to be given in isolation without any real thought. &nbsp;This leads to loss of technical separation, and without pilot action actual separation. &nbsp;Student needs to look at the traffic picture and then make decisions, not the other way around.</p>'),
(92, 1241902, 1031024, 9, 6, '2016-04-20', '2016-04-18', '<p>An ok introduction to Shannons airspace. Theres clearly an understanding of area control techniques in there, but I would hope to see more confidence with regards to descent planning in your next session.</p><p>We need to talk about sector splits, and demonstrate the Oceanic process (although weve spoken about it in this session) but overall this was a good start.</p>'),
(93, 1280618, 1254805, 2, 14, '2016-04-20', '2016-04-20', '<p>Good first session with lots done, also did a ground session on sweatbox with 4 departures to put the theory on clearance to taxiing into moving aircraft.</p><p>Went over all <b>ATM positions and their&nbsp;responsibilities.</b></p><p>Learnt how to decode a basic<b> METAR.</b></p><p>Discussed <b>CAT A/B and C/D SIDs</b>, with the initial climbs for each and specifically KISHA1F and INKUR5B (3000 ft). Discussed reason for early turns on A/Bs.</p><p>Went over <b>RT</b>, which is&nbsp;good on your part for first session, remember to use Correction if you make a mistake and to prioritise transmissions aswell.</p><p>Discussed <b>Flight plans</b> and the flight level rule (East-Odd, West-Even) and <b>squawk codes.</b></p><p>Finally discussed <b>taxi routings,</b> and how <b>technical separation</b> is important, next session well put it into practice.</p>'),
(94, 1227329, 931070, 6, 11, '2016-04-21', '2016-04-17', '<p>Busy&nbsp;session. &nbsp;Tower was on-line initially&nbsp;allowing the student time to settle in on the approach position. &nbsp;No CTR was on-line initially. &nbsp;Mixture of arrivals and departures, both /t and /v. &nbsp;Tower went off line and the student provided top down services. &nbsp;This got busy as the student learned to prioritise between airborne and ground traffic. &nbsp;On two occasion the student seemed to reach their capacity and I offered to step in. &nbsp;However, after taking a few moments to compose themselves and clear their head they continued. &nbsp; CTR logged shortly after this. &nbsp;The importance of giving the airborne frequency on delivery was highlighted to the student as their workload was unnecessarily increased having to get airborne traffic over to CTR. &nbsp;Overall a good session with the controller displaying promising radar skills and a good understanding of forward planning.</p>'),
(95, 1254805, 931070, 11, 30, '2016-04-21', '2016-04-02', '<p>.</p>'),
(96, 1280618, 1254805, 2, 14, '2016-04-21', '2016-04-21', '<p>Went through a lot of theory again tonight, along with a busier sweatbox session on 28.</p><p>We discussed:</p><p><b>Runway change</b>: How to coordinate one, and how, as tower, to deal with it, getting the last landing aircraft and last departure before changing runway.</p><p><b>Runway preference: </b>Discussed how 16 couldnt be in use with a cloud ceiling of 70 feet for example, as that requires CATIII, which only 28/10 have. Discussed runway capacity aswell and how that favours 28 due to the capacity per hour compared to other runways.</p><p><b>Technical Separation: </b>We covered more of this, and Cian showed very promising situational awareness aswell as good methods of technical separation. We discussed strategic ways of taxiing aircraft up and down runway 16 and F for departure, to give tower a way of merging both queues to get the best flow of departures.</p><p>We went over all the theory from yesterday, everything good, just remember the AB SIDs have 4000 bar KISHA1F and INKUR5B of 3000, and CD SIDs have FL90.</p><p>Left to cover: VFR, Dublin TMA controller structure, non-standard situations and landing and departing aircraft. Very good progress so far, will do network controlling when you get the S1.</p>'),
(97, 1302705, 1220065, 4, 18, '2016-05-20', '2016-05-20', '<p>Didnt do very much did a quick sim session where Nathan showed some good technical separation and remembered all of his departure freqs on clearances. Just worked on comments previous mentors had put. Went over how to put up ATIS, we logged on to network for a half an hour but only got one bit of traffic. Progressing well should be ready for solo very soon</p>'),
(98, 1280618, 1254805, 3, 18, '2016-05-27', '2016-05-27', '<p>Very good session. Completed a Ground and tower file on sweatbox with little to no losses of separation. Discussed all theory done before and explained TMA structure. Discussed the 5-6 mile gap for departures and saw how it worked with aircraft.</p><p>10 departures 10 Arrivals</p>'),
(99, 1280618, 1254805, 3, 18, '2016-05-30', '2016-05-30', '<p>Another good session. Sweatbox on 16 and 28 completed.</p><p><b>Theory:</b></p><ul><li>Revised&nbsp;Dublin TMA controller structure, Cian knows that now.&nbsp;</li><li>Went over taxi routings, all known.</li><li>Winds and runway preference revised. Along with a runway change.</li><li>Learnt go-around procedure and coordination&nbsp;in that case.</li></ul><p><b>Sweatbox:</b></p><ul><li>Situational Awareness evident and applied by giving intermediate taxi routes. Well done.</li><li>Cian improved very well&nbsp;on judging the gap for arriving aircraft and departures. Remember the rule of thumb, a 5 mile gap very quickly comes down to 3 by the&nbsp;time clearance has been issued and departure begins to&nbsp;roll. <b>If you dont think its going to work, dont do it.</b></li><li>Flow was very good, aircraft always moving.&nbsp;</li><li>1 go around on runway 16 and one on 28, good for your first very busy session on tower. We covered coordination for go arounds aswell as what to do.&nbsp;</li></ul><p>We have yet to cover VFR at a later stage, providing an ATIS as a tower position and improving departures and arrivals further. Good progression.</p><p><br></p>'),
(100, 1333081, 1220065, 1, 13, '2016-05-31', '2016-05-31', '<p><b>Daniel </b>was very competent and a fast learner we covered the following in his first session:</p><ul><li>Euroscope fully set up<br></li><li>METAR reading covered</li><li>How to use Euroscope</li><li>Diffrence between A/B and C/D aircraft and their enitial climbs and SIDS</li><li>He is able to competently give clearences to A/B and C/D aircraft will be ready for Delivery clearnce in next session hopefully</li></ul><p>Things <b>Daniel</b> has to look over/remember for next session:</p><ul><li>Remember West and East bound rule: East: Uneven West: Even&nbsp;<br></li><li>Make sure you auto assign Squak&nbsp;<br></li><li>Go back over Metars and this link  http://www.vateud.net/training/atc-training/meteorology&nbsp;</li></ul><ul><li>Diffrence between A/B and C/D aircraft&nbsp;<br></li><li>Make sure their flight level is valid for the directions their heading&nbsp;</li></ul><p><br></p>'),
(101, 1281280, 1220065, 1, 14, '2016-05-31', '2016-04-02', '<p>Bug did not do session with Caoloan</p>'),
(102, 1333081, 1220065, 1, 13, '2016-06-01', '2016-06-01', '<p>We finished his Delivery role training and I am confident he would be able to log on as Delivery solo. Daniel also completed his S1 theory test and should be getting S1 today or tomorrow.&nbsp;&nbsp;We covered the following:</p><p><br></p><ul><li>Covered all the aspects of ground from the R/T from getting from stand to runway and from the runway to the stand</li><li>Touched very lightly to Technical Seperation and situational awareness</li><li>Will take him onto network soon hopefully so show him what its like how to connect etc</li></ul>'),
(103, 1280618, 1254805, 3, 3, '2016-06-02', '2016-06-02', '<p>Good session on Cork. Tediously worked through each movement and there were no losses of separation, and all aircraft were handled as efficiently as possible with minimal delay. Discussed airspace classes and VFR in preparation for Monday. After that,&nbsp;Cian will have progressed very well and will be put forward for a solo.</p>'),
(104, 1280618, 1254805, 3, 22, '2016-06-06', '2016-06-06', '<p>Session on Kerry tower and Waterford tower.&nbsp;</p><p>Kerry handled very well with <u>10 VFR departures</u> all given taxi in turn and departure.&nbsp;</p><p>Waterford was extremely busy, <u>12 arrivals (1 IFR)&nbsp;and 4 IFR&nbsp;departures.</u></p><p>Cian received all aircraft orbiting at a VRP, positioned them in turn for the approach using visuals, and extending downwinds etc. <b>Multitasking</b> ability was pushed to the limit, with 3 VFR on approach orbiting, backtracking IFR awaiting departure instructions, 5 VFR aircraft asking for joining instructions and all were given their individual instructions efficiently with very good RT. We had a number of IFR movements, and went over how they are handled at regionals, and put them into practice in the mix with lots of VFR guys.&nbsp;Good <b>planning ability</b> evident when only 1 taxiway was available and you created a VFR gap 2 minutes before an IFR was due out. Very happy to see that, well done tonight!</p>'),
(105, 1306639, 1220065, 1, 13, '2016-06-07', '2016-06-02', '<p>Cover Metar Reading and Euroscope setup. Ciaran&nbsp;has his Euroscope fully set up and knows the basics of using it. I began to start showing him how to clear Flight plans and the West and Eats bound rule. I look forward to doing more session with Ciaran!</p>'),
(106, 1333081, 1220065, 1, 13, '2016-06-07', '2016-06-07', '<p>Went through everything Ground related and really put pressure on <b>Daniels</b> ground handling and R/T skills tonight. He performed reasonably well considering its only his third session. He got all of the R/T right (to a certain extent will be mentioned later). &nbsp;He integrated inbounds and outbounds and under went a good bit of stress.&nbsp;</p><p><br></p><p>What<b> Daniel </b>needs to remember and work on:</p><ul><li>Remeber to give Departure Freq on Initial Clearence</li><li>Remember to tick box when Clearence is read back correctly</li><li>Remember Push/Taxi/Depa tags</li><li>Take a second and think of what your going to say before you say it.</li><li>Technical Seperation remember to use it (although it was done quite well still could be better)</li></ul><p>Other than those I am very happy with his progress will be moving to EINN for next session to test his handling skills and to re check his R/T</p>'),
(107, 1227329, 931070, 6, 11, '2016-06-07', '2016-06-07', '<p>No show.</p>'),
(108, 1280618, 931070, 3, 18, '2016-06-07', '2016-06-07', '<p>Student had trouble with Euroscope and was unable to complete the session</p>'),
(109, 1302705, 1220065, 3, 18, '2016-06-07', '2016-06-07', '<p>Nathan did has improved a lot since my last session with him very pleased. Did a full 28 session with him and his technical separation was outstanding! Situational Awareness was also very good! Needs to remember departure freqs that was the only thing he did wrong and had a couple of go arounds. Will do a couple of sessions on the network next but very promising!</p>'),
(110, 1306639, 1220065, 1, 14, '2016-06-08', '2016-06-08', '<p>Okay good session today Ciaran, Today you learnt the full R/T for getting someone from Stand to Runway and back, We also covered trans atlantic clearances&nbsp;and substandard clearances.</p><p><br></p><p>Some of the notes I picked up from the session are the following:</p><ul><li>Sit Back and Relax! Take a minute know what your going to say and be confident while saying it<br></li><li>Make sure you change the C/D Sids to A/B sids when you have A/B aircraft such as PESIT to ABIDO etc</li><li>Listen to every clearance and make sure its correct so this includes push back and taxi not just initial flight plan clearance</li><li>Stobart not Strobart!</li><li>Inkur not what you were prounouncing it</li><li>Make sure everyone has their SQKS correct before taxi</li><li>Make sure you go back to planes if i cut you off or distract you eg.. If someone is about to read back their Flight plan clearance and someone cuts them off and ask for taxi make sure you go back&nbsp;and get the readback off him and dont forget about him!</li></ul>'),
(111, 1333081, 1220065, 3, 18, '2016-06-08', '2016-06-08', '<p>Great Session today Daniel almost ready for your test with Martin to get your ground validation! Here are the points I picked up on in todays session:</p><ul><li>Think before you speak</li><li>Not all A/B Departures are KISHA only Liffy and Dexen are but SIDS such as PESIT are ABIDO etc</li><li>Make sure if you tell someone to standby that you go back to them after your finished whatever you had to make them standby for!</li><li>Taxi instructions clear and the way i showed you so thats Taxiway holdpoint rwy eg Bravo B7 hold short rwy 10</li><li>Make sure you tell them to cross rwy 16/34 in the taxi instructions</li><li>Stay on top of things so make sure you know whats going on especially at the holding points dont leave people waiting</li></ul>'),
(112, 1302705, 1220065, 3, 18, '2016-06-09', '2016-06-08', '<p>Nathan did very good, we did a short session on Dublin and he did very well little no issues only problems that are re occurring is forgetting to check sqks before taxi, remembering tick boxes and push and taxi tags! Also R/T needs to be clear and more confident a lot of mistakes eg half way through transmission you would realise you made a mistake etc. We then moved to EICK which I think he managed very well implemented a good bit of technical separation and conditional clearances which was nice! Going to go over VFR next day&nbsp;</p>'),
(113, 1220065, 1254805, 6, 11, '2016-06-09', '2016-06-09', '<p>Loads of information thrown at you that you took down, learn it. Transition level, layer altitude etc. Airspace classes revised. Discussed speed controlling in the sweatbox, use it to maintain separation, it wont create it, use vectoring to do this. Discussed identification and verification, how to, when to/not to.&nbsp;</p><p>Technical separation will be a big learning thing, itll take time. Sequencing and streaming your arrivals, we saw how this worked briefly with RYR636 and EIN38W, turning one behind the other creates a stream of traffic and a sequence (landing order). <u>Practice will be the only way for you to learn this new form of controlling.</u></p>'),
(114, 1333081, 1220065, 3, 18, '2016-06-09', '2016-06-09', '<p>Daniel did very well we did a session on the network today. Daniel learnt how to connect to the network and how to set up his hardware. Only problem I saw through it was forgetting to set the push/taxi tags but other than that perfect. We had 5 departures including a vfr (Derp) but very pleased with Daniel</p>'),
(115, 1304314, 1254805, 3, 18, '2016-06-10', '2016-06-10', '<p>Could calculate crosswind component, knew runway preferences due to RETs (E6), and the intial climbs were all fine. Theory was fine,&nbsp;nothing major to be picked up on.&nbsp;</p><p><br></p><p>Did a sweatbox, in which Paul had almost 30 movements in 1 hour 10 minutes. Very, very&nbsp;well handled. Planning ahead was very evident, by stopping a pushback in advance of an arrival coming in, also spotted another situation a good 3 minutes before it happened regarding a blocked taxiway due to congestion.</p><p><b>RT</b> sometimes lacked information, taxi LINK3 can have 3 different meaning to a pilot then taxi LINK3 hold short F etc</p><p>Other thing to pick up on is <b>go-arounds</b>, get instructions in advance if you arent sure about the outcome of the situation, and just make the decision instead of letting it grow into a bigger problem.</p><p>Other than RT and non-standard things&nbsp;like go-arounds, it was handled very well. Putting you forward for your exam.</p>'),
(116, 1333081, 1254805, 3, 18, '2016-06-10', '2016-06-10', '<p>Firstly, very good RT. Couldnt fault you, every intstruction was clear and relevant.</p><p>Discussed RETs and runway capacity, aswell as runway preference.&nbsp;</p><p>Tonight you learnt the procedures for 16, how to deal with non standard situations, the Dublin departure control structure (1, 2, 3, 4) and runway preference, good session. Moving onto tower next session.</p><p>Very good methods of technical separation also conveyed by Daniel.</p>'),
(117, 1302705, 1220065, 3, 18, '2016-06-11', '2016-06-11', '<p>Covered VFR. Will do a VFR exam with him next session and answer any questions he has</p>'),
(118, 1220065, 1254805, 6, 23, '2016-06-12', '2016-06-11', '<p>Session completed again on Shannon (with aircraft on proper descent profiles!) and discussed more theory. Went through crosswind components, wind effects on aircraft in an approach environment and how headings may differ due to strong crosswinds. TAlt&nbsp;, TLVL and Transition Layer still known from last session and Dylan demonstrated how he could calculate them. We also went over methods of indentification, technical separation and thoroughly went through tags and the meaning of every bit of them. Also showed Dylan how to use the COPX alt to silently coordinate a Flight LVL that isnt set in stone. Good job, vectoring, separation and planning better and improving with each session.</p>'),
(119, 1280618, 1231276, 3, 18, '2016-06-12', '2016-06-12', '<p>My first mentoring session with Cian on the network. Handled a few A/C on the ground and did notice a few RT mistakes which can be easily fixed.&nbsp;</p><p>Use of the E7, Use it only if you need to make it easier for yourself if need be, I.E to separate A/C for a left turn or a right turn. The cargo area; if there is no traffic known to affect, just get the A/C cross 16/34 for Runway 10 to keep a Free Flow</p><p>As for VFR, This will be worked on, MOST likely on a sim file just to get you known to the RT and what you need to do/say as you was unsure of what you needed to do when the pilot wanted to route to a VRP.</p><p>The touch and go incident; ALWAYS give the wind and correct RT and not just Clear touch and go</p><p>EI-SAC, RUNWAY 10 CLEARED TOUCH AND GO SURFACE WIND 110 DEGREES @ 10 KNOTS for example.</p><p>A few mistakes CIan but nothing major and can be very easily fixed. A good session for my first time mentoring you, Just the odd bits and bobs.</p>'),
(120, 1333081, 1254805, 3, 18, '2016-06-13', '2016-06-13', '<p>First session on tower; taught Daniel how to calculate crosswind component and discussed difference between ground speed and indicated airspeed and how wind affects reduced landing capacity etc&nbsp;<br></p><p>Discussed ES tools and set up radar view for tower controlling along with symbology and went over ASR, ESE and .sct</p><p>Handled numerous IFR movements, no issues, all good. Two VFR movements sprung upon us, although we had time to go through everything and very efficiently handled two VFR zone transits at once, and gave traffic info to any IFR aircraft.&nbsp;</p><p>Very well done for first tower session, VFR to be covered more although you now have the basics of it. Good progress</p>'),
(121, 1229375, 1220065, 3, 18, '2016-06-14', '2016-06-14', '<p>First Session with Toby went very well! Covered all the R/T for getting from Stand to Runway also covered basic TWR R/T. Toby had previously controlled EGGD so he knew the basics already. We covered the following:</p><ul><li>Full R/T for Ground and Delivery</li><li>Cat A/B and C/D Aircraft&nbsp;</li><li>Un-Standard Departures</li><li>Trans Atlantic Clearences</li><li>Touched on technical seperation</li></ul><p>Next day we will put more pressure on Toby and see how he finds dealing with the traffic flow etc</p>'),
(122, 1302705, 1220065, 3, 27, '2016-06-14', '2016-06-14', '<p>Did a session with Nathan on the network on Waterford tower as the VFR Club had an event so Nathan had 10 VFR departures leaving the zone and one in the circuit. Nathan Handled them well, it was brilliant practise next thing he needs to do is work on VFR in Dublin and integrating VFRS on the circut with IFR Arrivals/Departures.&nbsp;</p>'),
(123, 1281627, 1220065, 1, 13, '2016-06-14', '2016-06-14', '<p>Unfortunately wasnt able to get much done with John as his Hamachi wasnt working. We covered the following:</p><ul><li>Cat A/B and C/D Departures and initial climbs&nbsp;</li><li>West and East Bound Rules</li><li>METAR reading&nbsp;</li><li>The R/T on how to clear a departure</li></ul>');
INSERT INTO `reports` (`id`, `student_cid`, `mentor_cid`, `report_type_id`, `position_id`, `submitted_date`, `session_date`, `text`) VALUES
(124, 1229375, 1231276, 3, 18, '2016-06-17', '2016-06-17', '<p>A good session tonight Toby. Gave Toby a sweatbox session for Runway 28&nbsp;with quite a bit of traffic on the ground. But I gave him no Inbound traffic as I wanted to see what he was like handling ground traffic with holding points etc etc. He handled them VERY well indeed, A few RT errors but that is due to you learning UK procedures.&nbsp;&nbsp;but can be&nbsp;easily fixed.&nbsp;</p><p><br></p><p>Situational awareness was bought up a few times as you let the A/C continue its taxi towards another A/C. I.E A RYR approaching F2 and a EIN coming out of Link 2. Again, an easy fix for this.</p><p><br></p><p>We shall continue with the sweatbox sessions and get your confidence up; The next session will include , Outbound and Inbound traffic and maybe some VFR in there as well.</p><p><br></p><p>Great first session with you Toby.</p><p><br></p>'),
(125, 1102385, 1231276, 3, 18, '2016-06-18', '2016-06-18', '<p>My very first session with Alan and a very good start indeed. We did a sweatbox session for EIDW_GND to learn some basics, Tags, squawks, initial climbs. handoffs to tower and giving correct clearances.</p><p>A very few RT errors and was quickly corrected in our session which was great. I heard plenty of confidence in Alan and picked up tips very quickly.</p><p>More A/C is needed to see what his situational awareness is like and separation on the ground.</p><p>A great first session indeed</p>'),
(126, 1102385, 1231276, 3, 18, '2016-06-19', '2016-06-19', '<p>Going to be Re-Scheduled&nbsp;</p>'),
(127, 1281627, 1220065, 1, 14, '2016-06-23', '2016-06-21', '<p>Did a good Sweatbox session with John. Covered all the R/T from Stand to Runway and back. Also covered which airlines park where etc. Next Session will start to get into technical seperation and looking at situational awareness</p>'),
(128, 1302705, 1254805, 3, 18, '2016-06-24', '2016-06-23', '<p>No show</p>'),
(129, 1227329, 1254805, 6, 23, '2016-06-24', '2016-06-24', '<p>No show</p>'),
(130, 1280618, 1254805, 3, 18, '2016-06-27', '2016-06-26', '<p>No show</p>'),
(131, 1280618, 1254805, 3, 18, '2016-06-27', '2016-06-26', '<p>No show</p>'),
(132, 1194728, 1254805, 6, 23, '2016-06-27', '2016-06-16', '<p>Cancelled by mentor</p>'),
(133, 1281627, 1254805, 2, 13, '2016-06-27', '2016-06-06', '<p>Cancelled</p>'),
(134, 1194728, 1254805, 6, 11, '2016-06-28', '2016-06-28', '<p>Discussed MSAs around Shannon, speed control to maintain gapsan vectors to create a gap, this was used when aircraft were turned too early on the approach to intercept the ILS and ended up close to other arrivals so vectors were used to create more space (6 miles).</p><p>Good discussion on technical separation wit arrivals and departures and vectors to maintain it. Good session.</p>'),
(135, 1220065, 1254805, 7, 11, '2016-07-03', '2016-07-03', '<p>Sweatbox session on runway 10 using point merge and a lot of vectoring due to 2 go-arounds thrown at Dylan and some aircraft that ran to the end of the sequencing arc which were then vectored.</p><p>R/T is still being worked on. Think about the turn before you issue it, i.e a left or right turn, the degree that the turn should be given to is always good and the reason for it is too.<b><br></b></p><p><b>Descend <u>to</u> altitude </b>3000 feet, <b>Descend Flight level</b> 80.&nbsp;</p><p>Airspace MSAs were adhered to although sometimes you forgot, when I hinted at it you instantly remembered, and you knew the difference between the MSA and the actual base of CAS. (MSA-500 feet = Base)</p><p>Separation was good, no losses, almost every aircraft had about 6-6.5 miles on the ILS, sometimes a bit under that when you forgot about speed restrictions you had issued, so keep the tags updated about every single instruction.</p><p>Youre showing good initial planning ability which a lot of people cant and never do get, so keep at it and always know what the sequence is. What we have to do next to progress further is to have high traffic levels with pilots on the network as opposed to sweatbox whilst coordinating. <br></p>'),
(136, 1194728, 1032602, 7, 11, '2016-07-03', '2016-07-03', '<p>No show.</p>'),
(137, 1281627, 1220065, 1, 14, '2016-07-03', '2016-07-03', '<p>Did a good dual sim session with John on ground and Sam on Approach. Today we moved onto Tower so we covered all the R/T for controlling tower, so giving minimum approach speeds, sequencing knowing when to slot departures in between arrivals and continued with a normal situation. Handled it well was slow when looking at charts but hopefully he will speed up when he has more practise.</p>'),
(138, 1280618, 1220065, 3, 18, '2016-07-03', '2016-06-25', '<p>cancelled</p>'),
(139, 1102385, 931070, 2, 14, '2016-07-04', '2016-06-15', '<p>Initial session configuring ES and connecting to the network. &nbsp;Some initial issues which too most of the session to work through.</p>'),
(140, 1304314, 931070, 5, 18, '2016-07-04', '2016-06-19', '<p>A capable display as was to be expected from the student and a comfortable pass.</p>'),
(141, 1241902, 931070, 9, 6, '2016-07-04', '2016-06-30', '<p>No session as I was delayed getting home.</p>'),
(142, 1241902, 931070, 9, 6, '2016-07-04', '2016-06-28', '<p>Initial session on Dublin Control. &nbsp;More an observation session to see how Ray handled the airspace without overloading him with the technicality of it. &nbsp;One issue was noted about the lack of separation, both technical and actual of two departing aircraft via LIFFY.</p>'),
(143, 1302705, 931070, 3, 18, '2016-07-04', '2016-06-21', '<p>check out session on Dublin Tower to determine the granting of a STV for EIDW. &nbsp;Nathan displayed a suitable level of controlling and has been awarded his STV.</p>');
